$(document).ready(function(){var e,s="";$(".searchBar").on("keyup",function(r){if($(".results").empty(),$(".results").removeClass("active"),console.log("emptied results"),s=$(".searchBar").val(),console.log("Search text: "+s),""!=s){$.ajax({url:"http://rack36.cs.drexel.edu/suggest/?q="+s,type:"GET",async:!1,success:function(s){e=JSON.parse(s)}});var a=e.length;$(".results").addClass("active");for(var t=0;a>t;t++)e[t].word.indexOf(s)>=0&&$(".results").append("<li>"+e[t].word+"</li>")}})});